const FetchData = () => {
    // Access the provinces data here
    const { provinces } = provincesData;

    // Example: Rendering province names
    return (
      <div>
        <h1>Provinces in Cambodia</h1>
        <ul>
          {Object.keys(provinces).map((provinceId) => {
            const { name, administrative_unit } = provinces[provinceId];
            return (
              <li key={provinceId}>
                <strong>Name:</strong> {name.km} ({name.latin}) <br />
                <strong>Administrative Unit:</strong> {administrative_unit.km} ({administrative_unit.latin})
              </li>
            );
          })}
        </ul>
      </div>
    );
  };

  export default FetchData;
